Meteor.subscribe("editUser");

if (Meteor.isClient) {

    Template.addPlayerForm.events({
        'submit form': function (event) {
            event.preventDefault();
            console.log("Form submitted");
            console.log(event.type);
        }
    });
    Template.editUser.helpers({});

}
